import React from 'react';
import { Card, Container } from '@mui/material';
import Box from '@mui/material/Box';
import Divider from '@mui/material/Divider';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import Grid2 from '@mui/material/Unstable_Grid2/Grid2';

const Welcome = ({ nextStep }) => {
    return (
        console.log(nextStep),
        <Container>
            <Box>
                <Card sx={{ minWidth: 275, p: 2 }}>
                    <Typography variant="body2" gutterBottom>
                        In this assessment, we will ask you a series of questions to determine how well you are doing with Agile.
                    </Typography>

                    <Typography variant="h6" gutterBottom>
                        There are 3 steps:
                    </Typography>
                    <Typography variant="body2" gutterBottom>
                        First, we will ask you some questions about your delivery frequency.

                        Then we will ask you some questions about your business.

                        And finally, we will ask you some questions about your processes.
                    </Typography>
                </Card>
                <Button variant="contained" color="primary" type="button" onClick={nextStep} sx={{ alignSelf: 'center' }}>
                    START
                </Button>
            </Box>
        </Container>
    );
};
export default Welcome;
